    def get_ladder_height(start_point: tuple[int, int], target_point: tuple[int, int], steps: int) -> int:
        """
        Returns the height of the ladder, given the start_point, target_point and steps
        >>> get_ladder_height((0, 0), (0, 1), 1)
        1
        >>> get_ladder_height((0, 0), (0, 1), 2)
        0
        """
        row, col = start_point
        target_row, target_col = target_point

        if row == target_row and col == target_col:
            return steps

        if col == target_col:
            return abs(target_row - row)

        if row == target_row:
            return abs(target_col - col)

        if abs(target_col - col) < abs(target_row - row):
            return abs(target_row - row)

        return abs(target_col - col)

    def get_ladder_length(
        start_point: tuple[int, int], target_point: tuple[int, int], steps: int
    ) -> int:
        """
        Returns the length of the ladder, given the start_point, target_point and steps
        >>> get_ladder_length((0, 0), (0, 1), 1)
        1
        >>> get_ladder_length((0, 0), (0, 1), 2)
        0
        """
        row, col = start_point
        target_row, target_col = target_point

        if row == target_row and col == target_col:
            return steps

        if col == target_col:
            return steps + abs(target_row - row)

        if row == target_row:
            return steps + abs(target_col - col)

        if abs(target_col - col) < abs(target_row - row):
            return steps + abs(target_row - row)

        return steps + abs(target_col - col)

    rows, cols = [int(x) for x in stdin.split()]

    if rows <= 0 or cols <= 0:
        return 0

    # max_ladder_lengths is the longest ladder we can get for a starting point
    max_ladder_lengths = [
        [-1] * cols for _ in range(rows)
    ]  # -1 means no ladder yet

    for i in range(rows):
        for j in range(cols):
            # target_point is the goal point
            target_point = (i, j)

            # ladder_height is the height of the ladder we can reach from the current starting point
            ladder_height = get_ladder_height(start_point=(i, j), target_point=target_point, steps=0)

            if ladder_height > 0:
                # ladder_length is the length of the ladder we can reach from the current starting point
                ladder_length = get_ladder_length(
                    start_point=(i, j), target_point=target_point, steps=0
                )

                if ladder_length == -1 or ladder_length > max_ladder_lengths[i][j]:
                    max_ladder_lengths[i][j] = ladder_length

    return max_ladder_lengths[-1][-1]

